import React, { useState, useEffect } from 'react';
import axios from 'axios';
import CustomerDataService from '../../services/CustomerDataService';
import {Link, Routes, Route, useNavigate} from 'react-router-dom'

function AddCustomer(props) {

    const navigate = useNavigate();
    
    const initialCustomerState = {
        id: null,
        name: "",
        contactNo: "",
        address: "",
        city: "",
        pin: "",
        email: "",
        stateId: "",
        pan: "",
        totalOutBal: "",
      };

      const [tutorial, setCustomer] = useState(initialCustomerState);
        const [submitted, setSubmitted] = useState(false);

        const handleInputChange = event => {
            const { name, value } = event.target;
            setCustomer({ ...tutorial, [name]: value });
        };

        const saveCustomer = () => {
            var data = {
              title: tutorial.title,
              description: tutorial.description
            };
        
            CustomerDataService.create(data)
              .then(response => {
                if (response.ok) {
                    console.log(response.data);
                    navigate('/customers');
                }
                console.log(response.data);
              })
              .catch(e => {
                console.log(e);
              });
          };

    const newCustomer = () => {
    setCustomer(initialCustomerState);
    setSubmitted(false);
    };     

    return (
        <>
            <div className="content-wrapper">
                <section className="content-header">
                    <h1>Add New Customer</h1>
                </section>
                <section className="content">
                    <div className="row">
                        <div className="col-xs-12">
                            <div className="box">
                                <div className="box-header">
                                    <h3 className="box-title"> Customer Master</h3>
                                </div>
                                <div className="box-body">
                                    <div className="row">
                                        <div className="col-md-6">
                                            <div className="form-group required">
                                                <label className="control-label">Customer Name</label>
                                                <input type="text" className="form-control" name="name" value={name} onChange={handleInputChange} />
                                            </div>
                                        </div>
                                        <div className="col-md-6">
                                            <div className="form-group required">
                                                <label className="control-label">Contact Number</label>
                                                <input type="text" className="form-control" name="contactNo" value={contactNo} onChange={handleInputChange} />
                                            </div>
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col-md-6">
                                            <div className="form-group required">
                                                <label className="control-label">Address</label>
                                                <input type="text" className="form-control" name="address" value={address}  onChange={handleInputChange} />
                                            </div>
                                        </div>
                                        <div className="col-md-3">
                                            <div className="form-group required">
                                                <label className="control-label">City</label>
                                                <input type="text" className="form-control" name="city" value={city} onChange={handleInputChange} />
                                            </div>
                                        </div>
                                        <div className="col-md-3">
                                            <div className="form-group">
                                                <label>Pin</label>
                                                <input type="text" className="form-control" name="pin" value={pin} onChange={handleInputChange} />
                                            </div>
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col-md-6">
                                            <div className="form-group">
                                                <label>State</label>
                                                <input type="text" className="form-control" name="stateId" value={stateId} onChange={handleInputChange} />
                                            </div>
                                        </div>
                                        <div className="col-md-6">
                                            <div className="form-group required">
                                                <label>Email</label>
                                                <input type="text" className="form-control" name="email" value={email} onChange={handleInputChange} />
                                            </div>
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col-md-6">
                                            <div className="form-group">
                                                <label>PAN</label>
                                                <input type="text" className="form-control" name="pan" value={pan}  onChange={handleInputChange} />
                                            </div>
                                        </div>
                                        <div className="col-md-6">
                                            <div className="form-group required">
                                                <label>Current Outstanding Balance</label>
                                                <input type="text" className="form-control" name="totalOutBal" value={totalOutBal} onChange={handleInputChange} />
                                            </div>
                                        </div>
                                    </div>
                                    <div className="row">
                                        <div className="col-md-3">
                                        </div>
                                        <div className="col-md-3">
                                            <button type="submit" className="btn btn-success btn-block btn-flat r-btn" onClick={saveCustomer}>Save</button>
                                        </div>
                                        <div className="col-md-6">
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        </>
    );
}

export default AddCustomer;
